func Test_subarrayBitwiseORs(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		fmt.Printf("~~%v~~\n", tc)
		ast.Equal(tc.ans, subarrayBitwiseORs(tc.A), ":%v", tc)
	}
}

func Benchmark_subarrayBitwiseORs(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			subarrayBitwiseORs(tc.A)
		}
	}
}
